export abstract class vCardBase {
    constructor(){}
    public firstName: string;
    public lastName: string;
    public companyName: string;
    public occupation = "CEO and Founder of Kirkland Enterprises Unlimited, LLC";
    public phoneNumber = "912-536-7419";
    public email = "kirklandenterprisesunlimited@gmail.com";
    public youtube: string;
    public website: string;
    public facebook: string;
    public instagram: string;
    public twitter: string;
    public snapchat: string;
    public linkedin: string;
    public tiktok: string;
}
